// import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://anburaghavan.netlify.app/images/logo.png" className="App-logo" alt="Anbu Raghavan" />

      </header>
    </div>
  );
}

export default App;
